var flkty_elements = document.querySelectorAll('.featured-collection--grid');
flkty_elements.forEach(function(elem){
  var flkty = new Flickity(elem, {
    // options
    cellAlign: 'left',
    contain: true,
    watchCSS: true, 
    prevNextButtons: false
  });
});


var root = document.querySelector(':root');
window.onload = function(){
  root.style.setProperty("--announcemet-height", document.querySelector('.announcement--root').clientHeight + 'px');
  root.style.setProperty("--header-height", document.querySelector('.header--root').clientHeight + 'px');
  if(document.body.contains(document.querySelector('.contact-page--root'))){
    document.querySelector('.contact-page--left-column').style.height=document.querySelector('#main-content').style.minHeight;
  }
}
window.onresize = function(){
  root.style.setProperty("--announcemet-height", document.querySelector('.announcement--root').clientHeight + 'px');
  root.style.setProperty("--header-height", document.querySelector('.header--root').clientHeight + 'px');
  setTimeout(function(){
    if(document.body.contains(document.querySelector('.contact-page--root'))){
    document.querySelector('.contact-page--left-column').style.height=document.querySelector('#main-content').style.minHeight;
    }
  },100);
}